Verenigde Staten / Nieuw-Zeeland / Duitsland
Avontuur / Fantasy
179 minuten

geregisseerd door Peter Jackson
met Elijah Wood, John Rhys-Davies en Viggo Mortensen

De hobbits Frodo en Sam trekken verder richting Mordor om hun taak, het vernietigen van de machtige Ene Ring waar de slechte 
Sauron naar op zoek is, te volbrengen. Hierbij krijgen ze hulp uit onverwachte hoek. Ondertussen proberen Merry en Pippin te 
ontsnappen uit de handen van een Uruk-Hai leger en helpen Legolas, Aragorn en Gimli koning Theoden van Rohan in zijn strijd 
tegen de legers van Saruman.
